<!-- eslint-disable no-console -->
<script setup lang="ts">
import type { ThreeEvent } from '@tresjs/core'
import { Box, OrbitControls } from '@tresjs/cientos'
import { TresCanvas } from '@tresjs/core'
import { BasicShadowMap, BoxGeometry, MeshToonMaterial, NoToneMapping, SRGBColorSpace } from 'three'
import '@tresjs/leches/styles'

const gl = {
  clearColor: '#202020',
  shadows: true,
  alpha: false,
  shadowMapType: BasicShadowMap,
  outputColorSpace: SRGBColorSpace,
  toneMapping: NoToneMapping,
  eventsEnabled: true,
}

function onPointerEnter(ev: ThreeEvent<MouseEvent>) {
  ev.eventObject.material.color.set('hotpink')
}

function onPointerLeave(ev: ThreeEvent<MouseEvent>) {
  ev.eventObject.material.color.set('darkGray')
}

function onPointerMissed(ev: ThreeEvent<MouseEvent>) {
  ev.eventObject.material.color.set('white')
}

const Z = 1.2
const geo = new BoxGeometry(1, 1, 1)
const numChildren = ref(0)
const groupRef = ref()

watch(groupRef, () => {
  numChildren.value = 0
  groupRef.value?.traverse(() => numChildren.value++)
})
</script>

<template>
  <OverlayInfo>
    <h1><code>@pointerenter @pointerleave</code></h1>
    <h2>Setup</h2>
    <p>This scene is composed of {{ numChildren }} objects, each with <code>@pointerenter</code> and <code>@pointerleave</code> events.</p>
    <h2>Preview</h2>
    <p>After interacting with the on-screen objects, they should look something like this.</p>
    <img src="data:image/png;base64," />
  </OverlayInfo>
  <TresCanvas
    window-size
    v-bind="gl"
  >
    <TresPerspectiveCamera
      :position="[11, 0, 8]"
      :look-at="[0, 0, 0]"
    />
    <OrbitControls />
    <TresGroup ref="groupRef">
      <Box v-for="x, xi in [-3, -1.5, 0, 1.5, 3]" :key="xi" :position="[x, 0, 0]" :scale="[1, 5, 0.5]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed">
        <Box v-for="y, i in [-0.25, 0.25]" :key="i" :position="[0, y, Z]" :scale="[1, 0.5, 1]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed">
          <Box v-for="yy, ii in [-0.25, 0.25]" :key="ii" :position="[0, yy, Z]" :scale="[1, 0.5, 1]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed">
            <Box v-for="yyy, iii in [-0.25, 0.25]" :key="iii" :position="[0, yyy, Z]" :scale="[1, 0.5, 1]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed">
              <Box v-for="yyyy, iiii in [-0.25, 0.25]" :key="iiii" :position="[0, yyyy, Z]" :scale="[1, 0.5, 1]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed">
                <Box v-for="yyyyy, iiiii in [-0.25, 0.25]" :key="iiiii" :position="[0, yyyyy, Z]" :scale="[1, 0.5, 1]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed">
                  <Box v-for="yyyyyy, iiiiii in [-0.25, 0.25]" :key="iiiiii" :position="[0, yyyyyy, Z]" :scale="[1, 0.5, 1]" :geometry="geo" :material="new MeshToonMaterial()" @pointerover="onPointerEnter" @pointerleave="onPointerLeave" @pointermissed="onPointerMissed" />
                </Box>
              </Box>
            </Box>
          </Box>
        </Box>
      </Box>
    </TresGroup>
    <TresDirectionalLight :intensity="1" :position="[3, 0, 0]" />
  </TresCanvas>
</template>
